  content: "Жил-был укурок по имени  моиарти. Он был типичным представителем
    своего рода: все время курил что-то непонятное и постоянно был в каком-то
    особенном состоянии. Однажды Василий решил, что ему скучно, и он захотел
    устроить себе приключение. \r

    \ \r

    Василий натянул на себя старый треугольный шляпу, найденную где-то в
    глубинах его бардачного шкафа, и отправился на поиски сокровищ. На улице его
    встретил сосед дядя Коля, который как раз поливал свой огород. Василий
    подошёл к нему и с серьёзным видом заявил: \r

    \ \r

    — Дядь  mg2at, я отправляюсь в далёкие земли за сокровищами! Не хочешь ли
    составить мне компанию? \r

    \ \r

    Дядь Коля, привыкший к странностям Василия, решил подыграть и, отложив
    лейку, ответил: \r

    \ \r

    — Конечно,  m3ga, что там за сокровища? \r

    \ \r

    — Легенда гласит, что за огромным холмом, что на краю города, спрятан
    сундук, полный золотых жёлудей, — мечтательно произнес Василий, — но чтобы
    его найти, нужно сначала пройти через Долину Смеха и преодолеть Гору
    Обжорства! \r

    \ \r

    — Ну что ж, — сказал дядя Коля, улыбаясь, — тогда не будем терять времени.
    \r

    \ \r

    Они отправились в путь, сначала прошли через поле, где на каждом шагу
    встречались смешные чучела, которые, казалось, посмеивались над ними.
    Василий время от времени останавливался, чтобы посмеяться вместе с чучелами,
    что ещё больше веселило дядю Колю. \r

    \ \r

    Когда они добрались до Горы Обжорства, перед ними открылся вид на огромное
    количество пирожков, булочек и конфет, которые стояли прямо на тропе.
    Василий сразу рванул вперёд, начал уплетать всё, что попадалось на глаза, и
    вскоре наелся до того, что едва мог двигаться. \r

    \ \r

    — Всё, дядь Коля, дальше я не могу... — простонал он, лежа на спине среди
    горы упаковок от конфет. — Тут и останусь, — добавил он с мечтательной
    улыбкой. \r

    \ \r

    Но дядя Коля нашёл выход. Он сбегал за тележкой, нагрузил туда Василия и
    довёз его до самой вершины горы, где их ждали долгожданные сокровища. Но
    оказалось, что вместо золотых жёлудей там лежал огромный запас чая и сушек.
    \r

    \ \r

    — Васька, это точно сокровища, — сказал дядя Коля, — такому богатству цены
    нет! \r

    \ \r

    \ \r

    \ \r

